From deep to dark. From past to future. All is about music.&#13;
&#13;
It all started in 2000 and since then this mysterious ladylike lifeform &#13;
has dedicated herself to learning &amp; analyzing sound in all of its forms:&#13;
Obsessive Analogy, Microloops coming from any source (even including fridge's plug),&#13;
IDM, Dubby, Dark Disco, Raw Techno, endless Miles Davis songs, Jakbeat, Analogic Deep Textures, &#13;
Sexual Dark Experimental Hybrids,Cosmic rhythm and beautiful Aquatic Dark Electro tracks.&#13;
&#13;
In this small biography you'll read about some of unforgettable moments this lady went through her life: &#13;
those timid and young sets at Ocio (Murcia) and many other city clubs in Spain while touching down on &#13;
uncountable raves and nights across northern Italy having first contact with german scene through the &#13;
homoelektrik group in Berlin and Leipzig, Moss club (Murcia), Fusion Festival (Lärz)... &#13;
In 2006 she collaborated with the Overflow Collective that was not only involved in parties &#13;
but in theatre and music workshops dealing with technology which then opened doors she &#13;
became apart of Montreal's electronic scene and Mutek festival.she lived during 2007, &#13;
as resident deejay at Laïka venue and participating in different clubbing events, like Piknik Electronik, &#13;
sharing billed events with many famous European and North American artists.&#13;
Once back in Spain (Valencia), she took up her career again as part of the Overflow team, where she began &#13;
showing her exquisite and authentic musical selection through plenty of clubs around the country and also abroad. &#13;
In 2008 Alienata was also responsible for musical direction of Overflow records label, &#13;
where she was able to expand her good and expert musical taste.&#13;
&#13;
In late 2011 she decided to move to Berlin.&#13;
She is currently working on a musical project called Kat Channel with Snuffo (50% of Snuff Crew) that will come out in a few months.&#13;
